import {Container} from "@/styles/atoms/WorkspaceButton";

function WorkspaceButton(props: WorkspaceButtonProps): JSX.Element {
  return (
    <Container backgroundColor={props.color}>
      <span>{props.name}</span>
    </Container>
  );
}

export default WorkspaceButton;
